import React from 'react'
const ThreeD = (url) => {
  return (
    <>      
      <div className="sketchfab-embed-wrapper">
        <iframe title="A 3D model" width="100%" src={url} frameBorder="0" allow="autoplay; fullscreen; vr"></iframe>
      </div>
    </>
  )
}

export default ThreeD
